'use strict';

var ENS = {
    bytecode: "",
    abi: [
        {
            "inputs": [],
            "payable": false,
            "type": "constructor",
            "stateMutability": "nonpayable"
        },
        "function setOwner(bytes32 node, address owner)",
        "function setSubnodeOwner(bytes32 node, bytes32 label, address owner)",
        "function setResolver(bytes32 node, address resolver)"
    ]
};

var HashRegistrarSimplified = {
    bytecode: "",
    abi: [
        {
            "inputs": [
                {
                    "name": "_ens",
                    "type": "address"
                },
                {
                    "name": "_rootNode",
                    "type": "bytes32"
                },
                {
                    "name": "_startDate",
                    "type": "uint256"
                }
            ],
            "payable": false,
            "type": "constructor",
            "stateMutability": "nonpayable"
        },
    ]
};

var ReverseRegistrar = {
    bytecode: "",
    abi: [
        {
            "inputs": [
                {
                    "name": "ensAddr",
                    "type": "address"
                },
                {
                    "name": "resolverAddr",
                    "type": "address"
                }
            ],
            "payable": false,
            "type": "constructor",
            "stateMutability": "nonpayable"
        }
    ]
}

var PublicResolver = {
    bytecode: '',
    abi: [
         {
             inputs: [
                 { name: "ensAddr", type: "address" }
             ],
             type: "constructor"
         }
    ]
};

async function deploy() {
    var address = await accounts[0].getAddress();

    // tmp
    //var ens = new ethers.Contract('0x20f4e46dC9c75Bcc031ca559dBAaBa494EfD95C6', ENS.abi, accounts[0]);

    var abstractENS = new ethers.Contract(null, ENS.abi, accounts[0]);
    var ens =  await abstractENS.deploy(ENS.bytecode);
    console.log('Deploying ENS:', ens.address)
    await ens.deployed();
    console.log('Deployed!')

    // tmp
    //var hashRegistrarSimplified = new ethers.Contract('0x775BE0Ba880A3dd82AC4e1ebA16931C8B607b1e5', HashRegistrarSimplified.abi, accounts[0]);

    var abstractHashRegistrarSimplified = new ethers.Contract(null, HashRegistrarSimplified.abi, accounts[0]);
    let hashRegistrarSimplified = await abstractHashRegistrarSimplified.deploy(
        HashRegistrarSimplified.bytecode,
        ens.address,
        ethers.utils.namehash('eth'),
        0);
    console.log('Deploying HashRegistrarSimplified:', hashRegistrarSimplified.address);
    await hashRegistrarSimplified.deployed();
    console.log('Deployed');

    var tx = await ens.setSubnodeOwner(ethers.constants.HashZero, ethers.utils.id('eth'), hashRegistrarSimplified.address);
    console.log('Adding .eth node', tx.hash);
    await tx.wait();
    console.log('Done.');

    //var publicResovler = await provider.resolveName('resolver.eth');
    var abstractPublicResolver = new ethers.Contract(null, PublicResolver.abi, accounts[0]);
    let publicResolver = await abstractPublicResolver.deploy(PublicResolver.bytecode, ens.address);
    console.log('Deploying Public Resovler:', publicResolver.address);
    await publicResolver.deployed();
    console.log('Deployed');

    var abstractReverseRegistrar = new ethers.Contract(null, ReverseRegistrar.abi, accounts[0]);
    let reverseRegistrar = await abstractReverseRegistrar.deploy(ReverseRegistrar.bytecode, ens.address, publicResolver.address);
    console.log('Deploying Reverse Registrar:', reverseRegistrar.address);
    await reverseRegistrar.deployed();
    console.log('Deployed');

    console.log('Adding reverse node');
    tx = await ens.setSubnodeOwner(ethers.constants.HashZero, ethers.utils.id('reverse'), address);
    await tx.wait();
    console.log('Done.');

    console.log('Adding addr.reverse node');
    tx = await ens.setSubnodeOwner(ethers.utils.namehash('reverse'), ethers.utils.id('addr'), reverseRegistrar.address);
    await tx.wait();
    console.log('Done.');
}

deploy();
